br />\n[checkbox checkbox-308 use_label_element \"I got more than I paid for\" \"The price was a good value\" \"Pretty expensive, but I see the value\n\" \"Probably not worth it for next time\" \"Going to look around\" \"I feel like I wasted my money\"]\n\n\n<h3>Did you like our service enough to refer us to a friend or business?</h3><br />\n[checkbox checkbox-309 use_label_element \"Yep, I can\'t wait to share your service with a friend\" \"Ah, maybe if my friend can\'t find anyone else\" \"I wouldn\'t tell my worst enemy about your company\"]\n\n<h3>Would you like us to contact you to discuss your experience?</h3><br />\n[checkbox checkbox-310 use_label_element \"Yes\" \"No\"]</p>\n\n<p>If yes, what is your e-mail address?<br />\n[text text-341]</p>\n\n<p>Who serviced your home or business?<br />\n[text text-342]</p>\n\n\n<p>Other Comments?<br />\n    [textarea your-message] </p>\n\n[captchac captcha-474]\n[captchar captcha-474]\n\n\n<p>[submit \"Send\"]</p>\n\n&nbsp;\n&nbsp;'),(1031,321,'_mail','a:7:{s:7:\"subject\";s:21:\"ProCare Feedback Form\";s:6:\"sender\";s:58:\"\"Pro Care Window Cleaning\"<info@procarewindowcleaning.com>\";s:4:\"body\";s:657:\"How did you hear about us? [menu-335]\n\nHow was our professionalism? Were we clean and courteous? Did you feel comfortable having us around?\n[checkbox-305]\n\nHow was our workmanship?\n[checkbox-306]\n\nWere we on time?\n[checkbox-307]\n\nHow was the value of our service?\n[checkbox-308]\n\nDid you like our service enough to refer us to a friend or business?\n[checkbox-309]\n\nWould you like us to contact you to discuss your experience?\n[checkbox-310]\n\nIf yes, what is your e-mail address? [text-341]\n\nWho serviced your home or business? [text-342]\n\nOther comments?\n[your-message]\n\n--\nThis e-mail was sent from a contact form on  (http://www.procarewindowcleaning.com)\";s:9:\"recipient\";s:63:\"procarewindowcleaning@gmail.com, info@procarewindowcleaning.com\";s:18:\"additional_headers\";s:0:\"\";s:11:\"attac