INSERT INTO `wp_posts` VALUES (5,1,'2008-02-25 03:17:53','2008-02-25 09:17:53','<script type=\"text/javascript\" src=\"http://www.angieslist.com/webbadge/insertwebbadge.js?bid=2193d18adae0c0965aeb0fb0885baa52\"></script><script type=\"text/javascript\">if (BADGEBOX) BADGEBOX.PlaceBadge();</script><noscript><a href=\"http://www.angieslist.com/companylist/us/wa/bellevue/pro-care-inc-reviews-243400.aspx\" title=\"Angie\'s List Super Service Award winner\">SEATTLE pressure washing</a></div></noscript>  <p style=\"text-align: left;\">Thank you for considering ProCare Services -Â A small locally owned and operated window, roof, and gutter cleaning company in Kirkland, WA. We have been considered one of the very best in the Bellevue, Kirkland and Redmond areas for gutter, roof, and window cleaning. We have been honored to receive the <strong>Angie\'s List Super Service Award every consecutive year since 2008. </strong>We look forward to providing you with the same award winning service.</p>\r\n<p style=\"text-align: left;\">Hope to hear from you soon,</p>\r\n<p style=\"text-align: left;\">Andy</p>\r\n\r\n','Pro Care Window Cleaning - Offering professional services ranging from window cleaning to pressure washing, gutter cleaning and even roof cleaning in Kirkland, Seattle, Bellevue, and Redmond.',0,'','publish','closed','closed','','about-2','','','2015-09-03 17:31:38','2015-09-03 17:31:38','',0,'http://beta.procarewindowcleaning.com/?page_id=5',0,'page','',0),(8,1,'2008-09-12 07:07:47','2008-09-12 07:07:47','<h2>Window Cleaning</h2>\r\nHaving clean windows can really brighten your day. It gives your house or building the clean touch you desire to make it look its best.Â We specialize in Kirkland window cleaning and also service the areas of Bellevue, Redmond, and Seattle.\r\n\r\nWe clean the following windows:\r\n<ul>\r\n	<li>Residential</li>\r\n	<li>Commercial (including high-rise buildings)</li>\r\n	<li>New construction (with a signed liability waiver)</li>\r\n	<li>Storm windows</li>\r\n	<li>French panes</li>\r\n	<li>Skylights</li>\r\n</ul>\r\n&nbsp;\r\n<h2>Pressure Washing</h2>\r\nPressure washing can provide tremendous improvements to your home or property. This service can fully restore the cosmetic look of concrete, aggregate, decks and vinyl. Cleaning these surfaces can greatly enhance the traction of your stairs, driveways, decks and walkways.\r\n\r\nWhen it comes to Kirkland pressure washing, knowledge and experience play a significant role in the outcome of the service provided. Worker safety and the protection of the surface being cleaned is our top priority when we are on your property, especially during roof cleaning Kirkland properties. We use fall protection equipment on roofs and continue to educate our professional team members on how to avoid dangerous, costly mistakes during Kirkland window cleaning and other jobs. We use commercial grade machines and high efficiency adaptation tools to give you superior workmanship at a competitive price, all while working with your preferred schedule.\r\n\r\nPressure Washing can do wonders for keeping the following surfaces safe, clean and looking great:\r\n<ul>\r\n	<li>Decks</li>\r\n	<li>Driveways</li>\r\n	<li>Patios</li>\r\n	<li>Brickwork</li>\r\n	<li>Siding</li>\r\n	<li>Roofs (some restrictions apply)</li>\r\n</ul>\r\n&nbsp;\r\n<h2>Gutter Cleaning</h2>\r\nUnlike some services done only for cosmetic reasons, gutters should be cleaned regularly to avoid any unnecessary costs associated with water damage or underground drainage problems. We have been doing gutter cleaning in Kirkland, Redmond, and Bellevue quite some time. Take a look at our <a href=\"http://www.procarewindowcleaning.com/testimonials/\" target=\"_blank\">testimonials here</a>.\r\n\r\nOur gutter cleaning service includes:\r\n<ul>\r\n	<li>Removing loose debris from the roof.</li>\r\n	<li>Removing debris from gutters and downspouts.</li>\r\n	<li>Thorough bagging up of any debris that may have landed on your grounds.</li>\r\n</ul>\r\n&nbsp;\r\n<h2>Moss treatments</h2>\r\nAs you may know unsightly moss will deteriorate your roof at an escalated rate that can eventually cause leaks. We can take care of this possibility and relieve the risk and the worry.\r\n\r\nWe will remove what we can of the moss by hand and then lay down a zinc sulfate mixture that will kill the remaining moss in a couple of weeks.\r\n&nbsp;\r\n&nbsp;\r\n&nbsp;','Kirkland window cleaning with a simple phone call, and Kirland pressure washing by professionals--thatâ€™s what our company provides! Roof cleaning Kirkland locations is easier when you call us! ',0,'','publish','open','open','','kirkland-window-cleaning-kirkland-pressure-washing-roof-cleaning-kirkland','','','2014-08-28 21:46:30','2014-08-28 21:46:30','',0,'http://procare.ecampaigntrail.com/?page_id=6',0,'page','',0),(14,1,'2008-09-12 07:24:10','2008-09-12 07:24:10','Our locally based business offers award wining Kirkland pressure washing, gutter, roof, and window cleaning services. Our focus is primarily Bellevue, Kirkland, Redmond, and Seattle, we are willing to service you wherever you might be located. Travel time and gas will be taken into consideration. Please give us a call we would love to show you our award winning gutter, roof, and window cleaning services at work. We have been honored to receive the Angieâ€™s List Super Service Award for 2008, 2009, 2010, and 2011','Kirkland Location',0,'','publish','open','open','','kirkland-location','','','2012-12-15 01:03:59','2012-12-15 01:03:59','',0,'http://procare.ecampaigntrail.com/?page_id=12',0,'page','',0),(15,1,'2008-09-12 07:30:48','2008-09-12 07:30:48','<img class=\"   alignleft\" style=\"margin-right: 15px; margin-bottom: 10px;\" title=\"Andy Pack\" src=\"/wp-content/uploads/andy-1.jpg\" alt=\"Andy Pack\" width=\"461\" height=\"308\" />\r\n\r\nProcare Inc. was initially started under the name Procare Pressure Washing by Andy Pack as a side business, until the summer of 2002, when he decided to make it a full time venture. It has since grown into a still small, but solid growing cleaning business.\r\n\r\nWe are trying to grow a company with trust honesty and dependability. We want you to feel comfortable with us in your home or business, and wewant togain your trust as being a company that provides tremendous value and quality. In an effort to do that, please see some ofthetestimonies of people wecontinue to do businesswith in thelocal area.Â  These are real unedited testimonies of local people in your area.\r\n\r\nProCare Inc.has almost completely been a referral based business and has been thankful for the hundreds and hundreds ofreferrals it has received.\r\n\r\nBeing Northwest native, I personally am thankful for living in a great city like Seattle. In spite of the rain and traffic at times, it is an enjoyable city with a lot of Godâ€™s creation close by to explore and engage. My life usually consists of spending time with local friends, working, attending church andtrying to seewhere I can be of use and help.\r\n\r\nOur company is fully licensed and insured. Workers arecovered under LNI, and are paid in compliance with Washington State requirements.\r\n\r\nI Hope you will give us a try!Â  We are quite sure you will not be disappointed!\r\n\r\nSincerely,\r\n\r\nAndy Pack','About Us',0,'','publish','open','open','','about-us','','','2013-10-08 17:43:34','2013-10-08 17:43:34','',0,'http://procare.ecampaigntrail.com/about-us/',0,'page','',0),(19,1,'2008-09-17 07:43:37','2008-09-17 07:43:37','','Blog - Roof Cleaning Kirkland',0,'','publish','closed','closed','','blog-roof-cleaning-kirkland','','','2012-11-15 00:36:25','2012-11-15 00:36:25','',0,'http://beta.procarewindowcleaning.com/?page_id=19',0,'page','',0),(23,1,'2008-09-17 21:40:40','2008-09-17 21:40:40','Call today for a free estimate or simply fill out the form below.\r\n\r\n[contact-form-7 id=\"314\" title=\"Free Estimate\"]\r\n\r\n&nbsp;','Free Estimate',0,'','publish','open','open','','free-estimate','','','2014-07-08 05:30:52','2014-07-08 05:30:52','',0,'http://beta.procarewindowcleaning.com/?page_id=23',0,'page','',0),(27,1,'2008-09-17 22:06:58','2008-09-17 22:06:58','Phone:Â  206-227-5837\r\nEmail : <a href=\"mailto:info@procarewindowcleaning.com\">info@procarewindowcleaning.com</a>\r\n\r\n<strong>Mailing address:</strong>\r\n<div>12400 Se 38th st #50801</div>\r\n<div>Bellevue Wa 98015</div>\r\n&nbsp;','Contact Us',0,'','publish','open','open','','contact-us','','','2013-10-08 17:42:34','2013-10-08 17:42:34','',0,'http://beta.procarewindowcleaning.com/?page_id=27',0,'page','',0),(29,1,'2008-09-17 22:09:33','2008-09-17 22:09:33','\"We have used Pro Care Window Cleaning for washing the inside and outside of our windows, cleaning out the gutters on our steep roof, and pressure washing the patio. They were gentle, yet very thorough. They clean up after themselves and are very conscientious. They were recommended by our friends.\"\r\n<p style=\"text-align: right;\"><em style=\"font-style: italic;\"><strong style=\"font-weight: bold;\">-David S.</strong>, Bellevue, WA</em></p>\r\n\r\n\"I\'d highly recommend Pro Care Window Cleaning to anybody. They have great follow-up and are very respectable about your property when they are on site. The work always gets done when Andy says it will be done, by who he says is going to do it, so there are never any surprises. This is a really great neighborhood company and my experience with him has been very positive in all respects of the business.\"\r\n<p style=\"text-align: right;\"><em style=\"font-style: italic;\"><strong style=\"font-weight: bold;\">-Mark T.</strong>, Bellevue, WA</em></p>\r\n\r\n\"Andy Pack has been our window washer for several years- you immediately take a liking to Andy with his outgoing personality and his professionalism.Â  He keeps our office looking good all year long! The best part about ProCare is they also do pressure washing of buildings, driveways etc. I was so impressed with ProCare the first time I used them that I set up an appointment for him to come out to my house and take care of my windows and continue to do so to this day.Â  I highly recommend ProCare they are professional, timely, and the best part reasonably priced.\"\r\n<p style=\"text-align: right;\"><em><strong>-Lori Bradley</strong>, Red-Rose Chiropractic Clinic</em></p>\r\n<p style=\"text-align: left; \">\"Andy, The windows at the buildings in our portfolio look great. Your team at Pro Care performed the window cleaning at the buildings quickly and with minimal impact to the residents. I will recommend to the owners that we schedule service with you from this point on.\"</p>\r\n<p style=\"text-align: right; \"><strong><em>-Stuart McTaggart, </em></strong><em>Property Manager, Darco Inc.</em></p>\r\n\r\n\"I highly recommend Andy Pack with Procare.Â  I have worked with Andy for years and have referred him to many clients who have all been extremely satisfied.Â  Andy is professional, punctual, trustworthy and does a fabulous job!\"\r\n<p style=\"text-align: right;\"><strong><em>-Beth Billington, </em></strong><a href=\"www.bethbillington.com\"><em>Coldwell Banker Bain</em></a></p>\r\n<p style=\"text-align: right; \"></p>\r\n\r\n\"My wife and I have been selling high end homes in and around the Eastside for 15 + years.Â  Our job requires that we surround ourselves with a variety of contractors, handyman and others in order to get a home ready to market.Â  One of the biggest challenges everyone in our industry faces is finding honest, reliable, hardworking and reasonable priced people to complete projects.Â Andy at Procare was recommend to us around 2004 and we have used him ever since.\r\n<p style=\"text-align: right;\"><em><strong>-Mark Krill</strong>, Windermere Real Estate</em></p>\r\n<p style=\"text-align: left;\">\"ProCare has always done a really good job for me. I have used them for years now and refer them to all my friends.\"</p>\r\n<p style=\"text-align: right;\"><em> <strong>-Marie Toedtli</strong>, Kirkland </em></p>\r\n<p style=\"text-align: left;\">\"You guys are great! What else can I ask for?Â  You\'re dependable, honest and do a great job every time.\"</p>\r\n<p style=\"text-align: right;\"><em> <strong>- Pat Brzusek</strong>, Bellevue</em></p>\r\n<p style=\"text-align: right;\"><em> </em></p>\r\n\r\n<h4><em><span style=\"color: #333399;\">ProCare isÂ also accountable to \"Angies List\" a contractor/tradesman rating company and has received an overall A rating from \"Angie\'s List\" customers. Â In addition we have been honored to receive the Super Service Award every year since 2008.</span></em></h4>','Testimonials',0,'','publish','open','open','','testimonials','','','2012-03-12 19:07:41','2012-03-12 19:07:41','',0,'http://beta.procarewindowcleaning.com/?page_id=29',0,'page','',0),(42,1,'2008-09-17 22:26:51','2008-09-17 22:26:51','[contact-form-7 id=\"321\" title=\"Feedback Form\"]','Feedback',0,'','publish','open','open','','feedback','','','2014-07-08 05:57:09','2014-07-08 05:57:09','',0,'http://beta.procarewindowcleaning.com/?page_id=42',0,'page','',1),(45,1,'2008-09-19 23:59:56','2008-09-19 23:59:56','','Site Map',0,'','publish','open','open','','site-map','','','2008-09-19 23:59:56','2008-09-19 23:59:56','',0,'http://beta.procarewindowcleaning.com/?page_id=45',0,'page','',0),(48,1,'2008-09-22 05:55:28','2008-09-22 05:55:28','<strong>What advice do you have for a customer looking to hire a provider like you?\r\n</strong>\r\n\r\nI would just ask them what is important to them? For most of our customers dependability, security and quality are at the top of their list. Dependability is something that is really important to me as a customer and in turn an ingrained bedrock value I have consistently sought to deliver on.As for security I know the background and history of my employees and would vouch for the character of each one. This provides me with both the piece of mind to send them in my stead and hopefully you can grow also enjoy the same peace of mind with them in around your home, family and belongings. One of the main reason for being hired is our reputation for quality. It is usually the reason we get hired. We want to provide a truly value based service. Although we are not always the cheapest (not even a possible goal) we are usually considered more than reasonable when comparing the overall value.\r\n\r\n<strong>If you were a customer, what do you wish you knew about your trade? Any inside secrets\r\nto share?</strong>\r\n\r\nMost customers are surprised to find out that although most of the other services we provide areÂ charged sales tax on top of the bill, a window cleaning service is exempt from sales tax under mostÂ conditions.\r\n\r\n<strong>Why does your work stand out from others who do what you do?</strong>\r\n\r\nIF you look at our website and the reviews listed you will find that people have been unusuallyÂ happy with our work. I give the credit to the great employees I have. They are courteous, friendly,Â timely and detailed.\r\n\r\n<strong>What do you like most about your job?</strong>\r\n\r\nWe have the occasional miserable day but for the most part we love being outside and meetingÂ so many interesting people. It brings great joy to provide a predictable consistent service thatÂ customers appreciate.\r\n\r\n<strong>What questions do customers most commonly ask you? What\'s your answer?</strong>\r\n\r\nDo you do highrise buildings? We do some tall buildings but most are under 6 stories and it is notÂ a major part of our business. We actually enjoy the one on one contact of the residential market.\r\n\r\n<strong>If you have a complicated pricing system for your service, please give all the details here.</strong>\r\n\r\nOur services are generally priced per job and not per hour. They vary so much when an hourlyÂ figure is requested that it is difficult to quote. Factors I consider when quoting a price is drive time, risk, materials, and who on the team is qualified to complete the task at hand. Are we going to be hanging over the side of a building, using a boom lift, cleaning a simple store front retail space or residential home? All of these variables just make it easier for me to bid the job and settle on a price. For most of my clients they really like the per job method because then they know that whatever the job takes in terms of time spent the cap price quoted is the price billed. I can see how an hourly rate can be desirable but the efficiency and quality of companies can vary so widely that from my experience the hourly rate should rarely be considered.\r\n\r\n<strong>When should I get my windows cleaned?</strong>\r\n\r\nIf you are one that likes to really keep your house looking sharp generally 3-4 times a year should do the trick.Â Â Having a consistent serviceÂ plays more of a factorÂ in having clean windows than time of year due to theÂ unpredictableÂ weather of ourÂ seasons.Â  That being said we have commercial customers that need there windows cleaned biweekly to maintain cleanliness, whileÂ some of our otherÂ residential clients range from every two months to yearly based on the importance ofÂ there view, theÂ exposure to the elementsÂ and thereÂ budget.\r\n\r\n<strong>What if its raining?</strong>\r\n\r\nRain is a consistent element of our weather here in Seattle.Â  Although heavy horizontal rain will leave some water spots on the glass . Generally the eves of the house protect the glass substantially. We are geared and prepared to work in the elements leaving a huge improvement in the before and afterÂ look of the glass.\r\n\r\n<strong>WillÂ you take any special precautions on the inside of my house?</strong>\r\n\r\nWe really strive to leave noÂ trace ofÂ our presence in your home other than clean windows and a happy customer. WeÂ accomplish this forÂ example by wearing such things as shoe covers, putting down drop cloths and making sure we send people into your home that are skilled and care about your stuff. IfÂ an accidentÂ was to happen we are willing to take responsibilityÂ and work towards a solution that you are satisfied with.\r\n\r\n<strong>Do you clean downspouts?</strong>\r\n\r\nWe do. Usually the way in which we clean the gutters willÂ takes care of this.Â If you have a particularly troublesome downspout weÂ generally have the right equipment to get things flowing smoothly again. Upper downspouts (above ground downspouts) can be cleared out for a very nominal fee if they did not respond to basic cleaning.Â  For below ground drainage systems we have some equipment that will, for the majority work for that as well. This service is a bit more but will save you hundreds in comparison with a Rotor Rooter type company.\r\n\r\n<strong>Will you guys leave the debris from my gutters on the ground?</strong>\r\n\r\nThis is an area we know is important to our customers and therefore spend considerable time cleaning up after ourselves. Our small company for the majority is based on referrals and we know things like this will separate us from the competition and keep the happy customers we seek.\r\n\r\n<strong>How do you clean roofs?</strong>\r\n\r\nWell, our basic gutter cleaningÂ service usuallyÂ includes getting theÂ major roof debris off yourÂ roof only limited to the roofs accessibility. This service goes a long way in maintaining thus insuringÂ a roof\'s lifespan . We also will provide moss killer whichÂ willÂ kill the moss in a week or two and inhibit its growth and destructive nature.Â During this moss treatment service we can also include removing the majority of the moss by hand or simply leave the moss to break down over time.\r\n\r\nWe generally try to avoid pressure washing roofs but sometimes its the only option for the immediate results needed. We provide this service on a limited scale, based on roof type, age and desired outcome.\r\n\r\n<strong>How can I get on a routine worry freeÂ maintanence program?</strong>\r\n\r\nThat would be super simple. Just let us know at time of scheduling or billing and we will be sure to impute you into our outlook calender for theÂ routine scheduled maintanenceÂ of your windows, gutters, and pressure washing needs.Â This is a great idea to ensureÂ peace of mind and availabilityÂ even in the busiest weeks of the year.','FAQ',0,'','publish','open','open','','faq','','','2013-01-17 19:37:25','2013-01-17 19:37:25','',0,'http://beta.procarewindowcleaning.com/?page_id=48',0,'page','',0),(54,1,'2008-09-22 22:37:24','2008-09-22 22:37:24','','satisfaction-guarantee',0,'','inherit','open','open','','satisfaction-guarantee','','','2008-09-22 22:37:24','2008-09-22 22:37:24','',0,'http://beta.procarewindowcleaning.com/wp-content/uploads/2008/09/satisfaction-guarantee.jpg',0,'attachment','image/jpeg',0),(84,1,'2008-10-04 22:36:23','2008-10-04 22:36:23','The fall leaves are fast approaching us and it\'s probably a goodÂ time to clean the gutters on your home or business. ManyÂ riskyÂ homeowners do this project each year to properly maintain their homes. What you may notÂ know is just how often this service should really be done. <strong>Most homes in the Seattle area should really be cleaned a minimum of twice a year or more</strong> depending on theÂ type of trees and theirÂ proximity. We are in theÂ Evergreen State andÂ generally there isÂ no shortage of trees around us.\r\n\r\nThe many different seasons bring with them a variety of issues. In the summer and early fall we tend to have some brisk winds that bring loose branches and pine needles down onto our roofs and into our gutters.Â These leaves, needles and twigs should be removed in preparation for the heavy rains our city sees. <strong>AtÂ end of fall, it isÂ important to make sureÂ guttersÂ are clear as toÂ not allow ice dams to form around your downspouts. </strong>\r\n\r\nAny time standing water is allowed to form there is a tremendous amountÂ of weight being placed on your gutters that can resultÂ inÂ detachment of the gutter from the fascia board.Â After late winter rolls aroundÂ we areÂ safeÂ toÂ yet again pullÂ out theÂ leaves and needles. SummerÂ can also be aÂ great time to have us come out. Our most thorough cleaning of your roof and gutters can generally be done at this time with a backpack leaf blower . This can make for a time consuming and risky job.\r\n\r\nForÂ us this a normalcy and we have theÂ equipmentÂ to do a safe and effective job.Â Call us soon so we can take care of yourÂ home or commercial property andÂ dialogue more specifically as to how often is right for you. Â <strong>We promise you won\'t be disappointed with our work.</strong> The time and riskÂ we save you mayÂ just lead you toÂ state <strong>asÂ one of our customers put it Â \" You don\'t knowÂ how much I look forward to writing this check\".</strong>','Don\'t let this part of your home go unserviced',0,'','publish','open','open','','84','','','2012-10-16 06:23:41','2012-10-16 06:23:41','',0,'http://beta.procarewindowcleaning.com/?p=84',0,'post','',0),(129,1,'2009-01-10 00:45:37','2009-01-10 00:45:37','<p class=\"MsoNormal\" style=\"background: white; margin: 0in 0in 7.5pt; line-height: 14.4pt; mso-margin-top-alt: auto;\"><span style=\"font-size: 10pt; font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\';\">As we move into 2009 and clear the last bit of snow from our driveways, we are excited to receive the <a title=\"Angie\'s List\" href=\"http://www.angieslist.com/\" target=\"_self\"><span style=\"color: #97b7ca; mso-bidi-font-size: 11.0pt;\">Angieâ€™s List</span></a> </span><strong><span style=\"font-size: 10pt; font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-size: 11.0pt;\">2008 Super Service Award</span></strong><span style=\"font-size: 10pt; font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\';\"> in the </span><strong><span style=\"font-size: 10pt; font-family: \'Arial\',\'sans-serif\'; mso-farea